function KTextShape() {
	var res = new createjs.Container();
	var shape = new createjs.Shape();
	
	shape.graphics.f().s("#000000").ss(0.5,1,1).p("AhYAAICxAA");
	//shape.setTransform(273.4,201.7);

	var shape_1 = new createjs.Shape();
	shape_1.graphics.f("#000000").s().p("");
	//shape_1.setTransform(273.8,201.3);


	res.addChild(shape_1);
	res.addChild(shape);
	
	//res.regX = 360
	//res.regY = 210
	res.scale = 0.7
	return res;
}